import React, {useEffect} from 'react';
import Nav from "../../components/main/Nav";
import CommunityPostCard from "../../components/contents/community/CommunityPostCard";
import {createStyles, makeStyles, Theme} from "@material-ui/core/styles";
import {AppBar, Tab, Tabs, Box, Typography} from "@material-ui/core";
import CommunityOwnerIntro from "../../components/contents/community/CommunityOwnerIntro";
import CommunityVideo from "../../components/contents/community/CommunityVideo";

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            display: 'flex',
            flexWrap: 'wrap',
            justifyContent: 'center',
            overflow: 'hidden',
            backgroundColor: theme.palette.background.paper,
            width: '100%'
        },
        tabs: {
            flexGrow: 1,
            backgroundColor: theme.palette.background.paper,
        }
    }),
);


interface TabPanelProps {
    children?: React.ReactNode;
    index: any;
    value: any;
}

function TabPanel(props: TabPanelProps) {
    const { children, value, index, ...other } = props;

    return (
        <div
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box p={3}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    );
}

function a11yProps(index: any) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

const CommunityMain = () => {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
        setValue(newValue);
    };

    useEffect(() => {
        if (localStorage.getItem("token") == null) {
            window.location.href = "http://localhost:3000/login"
        }
    })

    return (
        <div>
            <Nav />
            <CommunityOwnerIntro />

            <AppBar position="static">
                <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
                    <Tab label="Community" {...a11yProps(0)} />
                    <Tab label="Video" {...a11yProps(1)} />
                    <Tab label="Item Three" {...a11yProps(2)} />
                </Tabs>
            </AppBar>
            <TabPanel value={value} index={0}>
                <div className={classes.root}>
                    <CommunityPostCard />
                    <br/>
                    <CommunityPostCard />
                    <br/>
                    <CommunityPostCard />
                    <br/>
                    <CommunityPostCard />
                    <br/>
                    <CommunityPostCard />
                </div>
            </TabPanel>
            <TabPanel value={value} index={1}>
                <CommunityVideo />
            </TabPanel>
            <TabPanel value={value} index={2}>
                Item Three
            </TabPanel>

        </div>
    );
};


export default CommunityMain;
